import React from 'react';
import ReactDOM from 'react-dom';
import { ThemeProvider } from 'next-themes';
import App from './App';

ReactDOM.render(
  <ThemeProvider enableSystem={true} attribute="class">
    <React.StrictMode>
      <App />
    </React.StrictMode>
  </ThemeProvider>,
  document.getElementById('root')
);
